import React from "react";
import Input from "../ui/input/input";
import "./loginForm.css";

const loginForm = () => {
  return (
    <form>
      <label>Vendosni numrin e celularit</label>
      <Input
        label="NUMER TELEFONI"
        inputtype="input"
        type="tel"
        name="phone"
        placeholder="+35569*******"
        pattern="+[0-9]{3}[0-9]{9}"
      />
      <button className="loginButton">KYCU</button>
    </form>
  );
};

export default loginForm;
